import me from './mee.jpg';
import './App.css';
import Navbar from './Navbar';
import ConsoleWindow from './Console';
import linkedin from './linkedin.svg'
import gmail from './gmail.svg';
import copyright from './copyright.svg';

function App() {
  return (
    <div className="App">
            <div className="overflow-x-hidden"> {/* Apply 'overflow-x-hidden' class */}
      <div className="flex justify-between">
        <div className="w-72 mt-4">
          <Navbar />
          <p className="mt-10">Hi there, Shubhada here</p>
          <img src={me} className="ml-7" alt="Image" />
        </div>
        {/* <div>sdsdasd</div> */}
        <div className="w-1/4 flex flex-col  border-l border-gray-300"> {/* Add border to create a separating line */}
            <ConsoleWindow />
        </div>
      </div>
      </div>
      <div className="bottom-left">
        <img src={copyright} className="w-4" alt="copyright" />
        <p>&copy; 2023 by Shubhada Mohite</p>
      </div>
    </div>
  );
}

export default App;
